      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 * - 83 IN ( col1 * col2 * + col2 * - col0 / + + col2, + col0 * col1, - 69 - + col1 );
  - name: tab0

outputs:
